window.bookSummaryJSON = "<p>Jonathan Drazen is a beautiful, damaged billionaire with a taste for obedience.</p> <p>Monica is a struggling musician who obeys no man.</p> <p>But she just made a wager with him - one she's sure she can win.</p> <p>If she loses, she spends the night under his command.</p> <p>If she wins...it doesn't matter. She just found out Jonathan doesn't lose his bets, and his women always end up where he wants them.</p> <p>And this bet she’s about to lose? It’s going to turn into much, much more than she realizes.</p> <p>A <i>USA Today</i> best seller and <i>Audie</i> Award Finalist under the title <i>Beg Tease Submit</i></p>"; 
